pragma solidity ^0.8.0;

import "./DAOInterface.sol";
import "./Token.sol";


contract DAO is DAOInterface {

    // The minimum debate period that a proposal can have
    uint constant minProposalDebatePeriod = 15 days;

    // The minimum debate period that a split proposal can have
    uint constant quorumReducePeriod = 60 days;

    // Period after which a proposal is closed (in the case `executeProposal` fails because it throws)
    uint constant executeProposalPeriod = 10 days;

    // Token contract
    Token token;

    // Proposals to spend the DAO's ether
    Proposal[] public proposals;

    // The quorum needed for each proposal is partially calculated by totalSupply / minQuorumDiv
    uint public minQuorumDiv;

    // Address of the curator
    address public curator;

    // The list of addresses the DAO is allowed to send ether to
    mapping (address => bool) public allowedRecipients;

    // Mapping of addresses blocked during a vote (not allowed to transfer DAO tokens)
    mapping (address => uint) public blocked;

    // Mapping of addresses and proposal voted on by this address
    mapping (address => uint[]) public votingRegister;

    // The minimum deposit (in wei) required to submit any proposal
    uint public proposalDeposit;

    // The accumulated sum of all current proposal deposits
    uint sumOfProposalDeposits;



    constructor(
        address _curator,
        uint _proposalDeposit,
        Token _token
        ) {
        token = _token;
        curator = _curator;
        proposalDeposit = _proposalDeposit;
        minQuorumDiv = 5; // sets the minimal quorum to 20%


        allowedRecipients[address(this)] = true;
        allowedRecipients[curator] = true;
        proposals.push();
    }

    modifier onlyCurator {
        require(msg.sender == curator, "Not a curator");
        _;
    }

    modifier onlyTokenholders {
        require(token.balanceOf(msg.sender) != 0, "Not a tokenHolder");
        _;
    }

    function newProposal(
        address _recipient,
        uint _amount,
        string memory _description,
        bytes memory _transactionData,
        uint _debatingPeriod
    ) onlyTokenholders public payable returns (uint _proposalID) {

        require(allowedRecipients[_recipient]
            && _debatingPeriod > minProposalDebatePeriod
            && msg.value >= proposalDeposit
            && msg.sender != address(this), "Not correct proposal");


        _proposalID = proposals.length;

        Proposal storage p = proposals.push();
        p.recipient = _recipient;
        p.amount = _amount;
        p.description = _description;
        p.proposalHash = keccak256(abi.encode(_recipient, _amount, _transactionData));
        p.votingDeadline = block.timestamp + _debatingPeriod;
        p.open = true;
        //p.proposalPassed = False; 
        p.creator = msg.sender;
        p.proposalDeposit = msg.value;

        sumOfProposalDeposits += msg.value;

        emit ProposalAdded(
            _proposalID,
            _recipient,
            _amount,
            _description
        );
    }


    function checkProposalCode(
        uint _proposalID,
        address _recipient,
        uint _amount,
        bytes memory _transactionData
    ) public view returns (bool _codeChecksOut) {
        Proposal storage p = proposals[_proposalID];

        return p.proposalHash == keccak256(abi.encode(_recipient, _amount, _transactionData));
    }


    function vote(uint _proposalID, bool _supportsProposal) public {

        Proposal storage p = proposals[_proposalID];
        require(block.timestamp < p.votingDeadline, "Too late");

        unVote(_proposalID);

        if (_supportsProposal) {
            p.yes += token.balanceOf(msg.sender);
            p.votedYes[msg.sender] = true;
        } else {
            p.no += token.balanceOf(msg.sender);
            p.votedNo[msg.sender] = true;
        }

        if (blocked[msg.sender] == 0) {
            blocked[msg.sender] = _proposalID;
        } else if (p.votingDeadline > proposals[blocked[msg.sender]].votingDeadline) {
            blocked[msg.sender] = _proposalID;
        }

        votingRegister[msg.sender].push(_proposalID);
        emit Voted(_proposalID, _supportsProposal, msg.sender);
    }


    function unVote(uint _proposalID) public {
        Proposal storage p = proposals[_proposalID];
        require(block.timestamp < p.votingDeadline, "Too late");

        if (p.votedYes[msg.sender]) {
            p.yes -= token.balanceOf(msg.sender);
            p.votedYes[msg.sender] = false;
        }

        if (p.votedNo[msg.sender]) {
            p.no -= token.balanceOf(msg.sender);
            p.votedNo[msg.sender] = false;
        }
    }


    function unVoteAll() public {

        for (uint i = 0; i < votingRegister[msg.sender].length; i++) {
            Proposal storage p = proposals[votingRegister[msg.sender][i]];
            if (block.timestamp < p.votingDeadline)
                unVote(votingRegister[msg.sender][i]);
        }

        delete votingRegister[msg.sender];
        blocked[msg.sender] = 0;
    }


    function executeProposal(
        uint _proposalID,
        bytes memory _transactionData
    ) public onlyCurator returns (bool _success) {

        Proposal storage p = proposals[_proposalID];

        if (p.open && block.timestamp > p.votingDeadline + executeProposalPeriod) {
            closeProposal(_proposalID);
            return true;
        }

        require(block.timestamp >= p.votingDeadline
            && p.open
            && !p.proposalPassed
            && p.proposalHash == keccak256(abi.encode(p.recipient, p.amount, _transactionData)),
            "Proposal cannot be executed");


        if (!allowedRecipients[p.recipient]) {
            closeProposal(_proposalID);
            payable(p.creator).transfer(p.proposalDeposit);
            return true;
        }

        bool proposalCheck = true;

        uint quorum = p.yes;


        if (quorum >= minQuorum(p.amount)) {
            (bool success,) = p.creator.call{value: p.proposalDeposit}("");
            require(success, "Transaction failed");      
        }

        if (quorum >= minQuorum(p.amount) && p.yes > p.no && proposalCheck) {

            p.proposalPassed = true;

            (bool success,) = p.recipient.call{value: p.amount}(_transactionData);
            require(success, "Transaction failed");

            _success = true;
        }

        closeProposal(_proposalID);

        emit ProposalCounted(_proposalID, _success, quorum);
    }


    function closeProposal(uint _proposalID) internal {
        Proposal storage p = proposals[_proposalID];

        if (p.open) {
            sumOfProposalDeposits -= p.proposalDeposit;
        }
        p.open = false;
    }


    function changeProposalDeposit(uint _proposalDeposit) external onlyCurator {

        proposalDeposit = _proposalDeposit;
    }


    function changeAllowedRecipients(address _recipient, bool _allowed) external onlyCurator returns (bool _success) {
        allowedRecipients[_recipient] = _allowed;

        emit AllowedRecipientChanged(_recipient, _allowed);
        return true;
    }


    function actualBalance() public view returns(uint _actualBalance) {
        return address(this).balance - sumOfProposalDeposits;
    }


    function minQuorum(uint _value) internal view returns (uint _minQuorum) {

        return token.totalSupply() / minQuorumDiv +
            (_value * token.totalSupply()) / (3 * (actualBalance()));
    }


    function numberOfProposals() public view returns (uint _numberOfProposals) {

        return proposals.length - 1;
    }


    function changeOrGetBlocked(address _account) public returns (bool) {
        if (blocked[_account] == 0) {
            return false;
        }
        Proposal storage p = proposals[blocked[_account]];
        if (!p.open) {
            blocked[_account] = 0;
            return false;
        } else {
            return true;
        }
    }


    function unblockMyAcc() public returns (bool) {
        return changeOrGetBlocked(msg.sender);
    }


    receive() external payable {}

}","keccak256":"0x0e46c2b634761067f2792eafc1ceb0c57b09a3f1b4fe7b4a848190d6db96d983","license":"MIT"},"contracts/DAOInterface.sol":{"content":"//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;


interface DAOInterface {

    struct Proposal {
        // The address where the `amount` will go to if the proposal is accepted
        address recipient;
        // The amount to transfer to `recipient` if the proposal is accepted.
        uint amount;
        // A text description of the proposal
        string description;
        // A unix timestamp, denoting the end of the voting period
        uint votingDeadline;
        // True if the proposal's votes have yet to be counted
        bool open;
        // the majority said yes
        bool proposalPassed;
        // A hash to check validity of a proposal
        bytes32 proposalHash;
        // Deposit the creator added when submitting their proposal
        uint proposalDeposit;
        // Number of Tokens in favor of the proposal
        uint yes;
        // Number of Tokens opposed to the proposal
        uint no;
        // Mapping to check if a shareholder has voted for it
        mapping (address => bool) votedYes;
        // Mapping to check if a shareholder has voted against it
        mapping (address => bool) votedNo;
        // Address of the shareholder who created the proposal
        address creator;
    }


    function newProposal(
        address _recipient,
        uint _amount,
        string memory _description,
        bytes memory _transactionData,
        uint _debatingPeriod
    ) external payable returns (uint _proposalID);


    function checkProposalCode(
        uint _proposalID,
        address _recipient,
        uint _amount,
        bytes memory _transactionData
    ) external returns (bool _codeChecksOut);


    function vote(uint _proposalID, bool _supportsProposal) external;


    function executeProposal(
        uint _proposalID,
        bytes memory _transactionData
    ) external returns (bool _success);


    function changeAllowedRecipients(address _recipient, bool _allowed) external returns (bool _success);


    function changeProposalDeposit(uint _proposalDeposit) external;


    function numberOfProposals() external returns (uint _numberOfProposals);


    function changeOrGetBlocked(address _account) external returns (bool);


    function unblockMyAcc() external returns (bool);


    receive() external payable;


    event ProposalAdded(
        uint indexed proposalID,
        address recipient,
        uint amount,
        string description
    );

    event Voted(uint indexed proposalID, bool position, address indexed voter);

    event ProposalCounted(uint indexed proposalID, bool result, uint quorum);

    event AllowedRecipientChanged(address indexed _recipient, bool _allowed);

}","keccak256":"0x0d3b1e0a7813885e8d7d4930f2ef20db95b1dbd1d7968e7d72d52231d8e5fcd4","license":"MIT"},"contracts/Token.sol":{"content":"//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./TokenInterface.sol";
import "./DAO.sol";


contract Token is TokenInterface {

    string public name;
    string public symbol;
    uint  public decimals;

    uint256 public totalSupply;

    address public admin;

    mapping (address => uint256) balances;
    mapping (address => mapping (address => uint256)) allowed;

    DAO dao;

    constructor(
        string memory _tokenName,
        string memory _tokenSymbol,
        uint _decimalPlaces) {

        name = _tokenName;
        symbol = _tokenSymbol;
        decimals = _decimalPlaces;
        admin = msg.sender;
    }

    modifier onlyTokenholders {
        require(balanceOf(msg.sender) != 0, "Not a tokenHolder");
        _;
    }

    modifier onlyAdmin {
        require(msg.sender == admin, "Not an admin");
        _;
    }

    function setDAO(address payable _dao) external onlyAdmin {
        dao = DAO(_dao);
    }

    function createToken(address _tokenHolder) public payable returns (bool success) {
        require(msg.value > 0, "No payment"); 

        balances[_tokenHolder] += msg.value;
        totalSupply += msg.value;

        emit CreatedToken(_tokenHolder, msg.value);

        return true;
    }

    function withdraw() public onlyTokenholders returns (bool _success) {

        dao.unVoteAll();

        uint balanceOfSender = balances[msg.sender];

        uint fundsToWithdraw = (balanceOfSender * address(this).balance) / totalSupply;
        balances[msg.sender] = 0;

        payable(msg.sender).transfer(fundsToWithdraw);

        totalSupply -= balanceOfSender;

        emit Transfer(msg.sender, address(0), balanceOfSender);

        return true;
    }

    function balanceOf(address _owner) public view returns (uint256 balance) {
        return balances[_owner];
    }

    function transfer(address _to, uint256 _amount) external returns (bool success) {
        if (balances[msg.sender] >= _amount
            && _amount > 0
            && !dao.changeOrGetBlocked(msg.sender)
            && !dao.changeOrGetBlocked(_to)) 
           {

            balances[msg.sender] -= _amount;
            balances[_to] += _amount;

            emit Transfer(msg.sender, _to, _amount);

            return true;
        } else {
           return false;
        }
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _amount
    ) external returns (bool success) {

        if (balances[_from] >= _amount
            && allowed[_from][msg.sender] >= _amount
            && _amount > 0
            && !dao.changeOrGetBlocked(_to)
            && !dao.changeOrGetBlocked(_from)) {


            balances[_to] += _amount;
            balances[_from] -= _amount;
            allowed[_from][msg.sender] -= _amount;

            emit Transfer(_from, _to, _amount);

            return true;
        } else {
            return false;
        }
    }

    function approve(address _spender, uint256 _amount) public returns (bool success) {
        allowed[msg.sender][_spender] = _amount;

        emit Approval(msg.sender, _spender, _amount);

        return true;
    }

    function allowance(address _owner, address _spender) public view returns (uint256 remaining) {
        return allowed[_owner][_spender];
    }


    function getBalance() external view returns (uint) {
        return address(this).balance;
    }

}","keccak256":"0x6e380700298a2fa61f7ebc2e9b78390df8b5a2ef9df7fde9ecbf5b546880bfc8","license":"MIT"},"contracts/TokenInterface.sol":{"content":"//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;


interface TokenInterface {

    function balanceOf(address _owner) external returns (uint256 balance);

    function transfer(address _to, uint256 _amount) external returns (bool success);

    function transferFrom(address _from, address _to, uint256 _amount) external returns (bool success);

    function approve(address _spender, uint256 _amount) external returns (bool success);

    function setDAO(address payable _dao) external;

    function allowance(
        address _owner,
        address _spender
    ) external returns (uint256 remaining);

    function createToken(address _tokenHolder) external payable returns (bool success);

    function withdraw() external returns (bool _success);

    event CreatedToken(address indexed to, uint amount);

    event Transfer(address indexed _from, address indexed _to, uint256 _amount);

    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _amount
    );

}","keccak256":"0xa1c8627cb05ba6f4620f967772a3fbe9dd6aefc5927e4129cb4574977f6f21ab","license":"MIT"}},"version":1}

